pub enum AuthMechanism {

    /// MongoDB Challenge Response nonce and MD5 based authentication system. It is currently
    /// deprecated and will never be supported by this driver.
    MongoDbCr,

    /// The SCRAM-SHA-1 mechanism as defined in [RFC 5802](http://tools.ietf.org/html/rfc5802).
    ///
    /// See the [MongoDB documentation](https://docs.mongodb.com/manual/core/security-scram/) for more information.
    ScramSha1,

    /// The SCRAM-SHA-256 mechanism which extends [RFC 5802](http://tools.ietf.org/html/rfc5802) and is formally defined in [RFC 7677](https://tools.ietf.org/html/rfc7677).
    ///
    /// See the [MongoDB documentation](https://docs.mongodb.com/manual/core/security-scram/) for more information.
    ScramSha256,

    /// The MONGODB-X509 mechanism based on the usage of X.509 certificates to validate a client
    /// where the distinguished subject name of the client certificate acts as the username.
    ///
    /// See the [MongoDB documentation](https://docs.mongodb.com/manual/core/security-x.509/) for more information.
    ///
    /// Note: This mechanism is not currently supported by this driver but will be in the future.
    MongoDbX509,

    /// Kerberos authentication mechanism as defined in [RFC 4752](http://tools.ietf.org/html/rfc4752).
    ///
    /// See the [MongoDB documentation](https://docs.mongodb.com/manual/core/kerberos/) for more information.
    ///
    /// Note: This mechanism is not currently supported by this driver but will be in the future.
    Gssapi,

    /// The SASL PLAIN mechanism, as defined in [RFC 4616](), is used in MongoDB to perform LDAP
    /// authentication and cannot be used for any other type of authenticaiton.
    /// Since the credentials are stored outside of MongoDB, the "$external" database must be used
    /// for authentication.
    ///
    /// See the [MongoDB documentation](https://docs.mongodb.com/manual/core/security-ldap/#ldap-proxy-authentication) for more information on LDAP authentication.
    ///
    /// Note: This mechanism is not currently supported by this driver but will be in the future.
    Plain,

    /// MONGODB-AWS authenticates using AWS IAM credentials (an access key ID and a secret access
    /// key), temporary AWS IAM credentials obtained from an AWS Security Token Service (STS)
    /// Assume Role request, or temporary AWS IAM credentials assigned to an EC2 instance or ECS
    /// task.
    ///
    /// Note: Only server versions 4.4+ support AWS authentication. Additionally, the driver only
    /// supports AWS authentication with the tokio runtime.
    #[cfg(feature = "tokio-runtime")]
    MongoDbAws,
}

pub enum ReturnDocument {

    /// Return the document after modification.
    After,

    /// Return the document before modification.
    Before,
}

pub enum Hint {

    /// Specifies the keys of the index to use.
    Keys(Document),

    /// Specifies the name of the index to use.
    Name(String),
}

pub enum CursorType {

    /// Default; close the cursor after the last document is received from the server.
    NonTailable,

    /// Do not close the cursor after the last document is received from the server. If more
    /// results become available later, the cursor will return them.
    Tailable,

    /// Similar to `Tailable`, except that the cursor should block on receiving more results if
    /// none are available.
    TailableAwait,
}

pub enum UpdateModifications {

    /// A document that contains only update operator expressions.
    Document(Document),

    /// An aggregation pipeline.
    /// Only available in MongoDB 4.2+.
    Pipeline(Vec<Document>),
}

pub enum ReadConcernLevel {

    /// See the specific documentation for this read concern level [here](https://docs.mongodb.com/manual/reference/read-concern-local/).
    Local,

    /// See the specific documentation for this read concern level [here](https://docs.mongodb.com/manual/reference/read-concern-majority/).
    Majority,

    /// See the specific documentation for this read concern level [here](https://docs.mongodb.com/manual/reference/read-concern-linearizable/).
    Linearizable,

    /// See the specific documentation for this read concern level [here](https://docs.mongodb.com/manual/reference/read-concern-available/).
    Available,

    /// Specify a custom read concern level. This is present to provide forwards compatibility with
    /// any future read concerns which may be added to new versions of MongoDB.
    Custom(String),
}

pub enum Acknowledgment {

    /// Requires acknowledgement that the write has reached the specified number of nodes.
    ///
    /// Note: specifying 0 here indicates that the write is unacknowledged. Doing so means
    /// the driver will not receive a response indicating whether an operation succeeded or failed.
    /// It also means that the operation cannot be associated with a session. It is reccommended to
    /// avoid using unacknowledged write concerns.
    Nodes(i32),

    /// Requires acknowledgement that the write has reached the majority of nodes.
    Majority,

    /// Requires acknowledgement according to the given custom write concern. See [here](https://docs.mongodb.com/manual/tutorial/configure-replica-set-tag-sets/#tag-sets-and-custom-write-concern-behavior)
    /// for more information.
    Custom(String),
}

pub enum ValidationLevel {

    /// Perform no validation for inserts and updates.
    Off,

    /// Perform validation on all inserts and updates.
    Strict,

    /// Perform validation on inserts as well as updates on existing valid documents, but do not
    /// perform validations on updates on existing invalid documents.
    Moderate,
}

pub enum ErrorKind {

    /// Wrapper around [`std::net::AddrParseError`](https://doc.rust-lang.org/std/net/struct.AddrParseError.html).
    #[error(display = "{}", _0)]
    AddrParse(
              #[error(source)]
              std::net::AddrParseError),

    /// An invalid argument was provided to a database operation.
    #[non_exhaustive]
    #[error(display =
            "An invalid argument was provided to a database operation: {}",
            message)]
    ArgumentError {
        message: String,
    },

    /// An error occurred while the [`Client`](../struct.Client.html) attempted to authenticate a
    /// connection.
    #[non_exhaustive]
    #[error(display = "{}", message)]
    AuthenticationError {
        message: String,
    },

    /// Wrapper around `bson::de::Error`.
    #[error(display = "{}", _0)]
    BsonDecode(
               #[error(source)]
               crate::bson::de::Error),

    /// Wrapper around `bson::ser::Error`.
    #[error(display = "{}", _0)]
    BsonEncode(
               #[error(source)]
               crate::bson::ser::Error),

    /// An error occurred when trying to execute a write operation consisting of multiple writes.
    #[error(display =
            "An error occurred when trying to execute a write operation: {:?}",
            _0)]
    BulkWriteError(BulkWriteFailure),

    /// The server returned an error to an attempted operation.
    #[error(display = "Command failed {}", _0)]
    CommandError(CommandError),

    /// Wrapper around `trust_dns_resolver::error::ResolveError`.
    #[error(display = "{}", _0)]
    DnsResolve(trust_dns_resolver::error::ResolveError),

    #[non_exhaustive]
    #[error(display = "Internal error: {}", message)]
    InternalError {
        message: String,
    },

    /// Wrapper around `webpki::InvalidDNSNameError`.
    #[error(display = "{}", _0)]
    InvalidDnsName(
                   #[error(source)]
                   webpki::InvalidDNSNameError),

    /// A hostname could not be parsed.
    #[non_exhaustive]
    #[error(display = "Unable to parse hostname: {}", hostname)]
    InvalidHostname {
        hostname: String,
    },

    /// Wrapper around [`std::io::Error`](https://doc.rust-lang.org/std/io/struct.Error.html).
    #[error(display = "{}", _0)]
    Io(
       #[error(source)]
       std::io::Error),

    #[error(display = "No DNS results for domain {}", _0)]
    NoDnsResults(StreamAddress),

    /// A database operation failed to send or receive a reply.
    #[non_exhaustive]
    #[error(display =
            "A database operation failed to send or receive a reply: {}",
            message)]
    OperationError {
        message: String,
    },

    #[error(display = "{}", _0)]
    OutOfRangeError(
                    #[error(source)]
                    OutOfRangeError),

    /// Data from a file could not be parsed.
    #[non_exhaustive]
    #[error(display = "Unable to parse {} data from {}", data_type,
            file_path)]
    ParseError {
        data_type: String,
        file_path: String,
    },

    /// The server returned an invalid reply to a database operation.
    #[non_exhaustive]
    #[error(display =
            "The server returned an invalid reply to a database operation: {}",
            message)]
    ResponseError {
        message: String,
    },

    /// The Client was not able to select a server for the operation.
    #[non_exhaustive]
    #[error(display = "{}", message)]
    ServerSelectionError {
        message: String,
    },

    /// An error occurred during SRV record lookup.
    #[non_exhaustive]
    #[error(display = "An error occurred during SRV record lookup: {}",
            message)]
    SrvLookupError {
        message: String,
    },

    /// A timeout occurred before a Tokio task could be completed.
    #[cfg(feature = "tokio-runtime")]
    #[error(display = "{}", _0)]
    TokioTimeoutElapsed(
                        #[error(source)]
                        tokio::time::Elapsed),

    #[error(display = "{}", _0)]
    RustlsConfig(
                 #[error(source)]
                 rustls::TLSError),

    /// An error occurred during TXT record lookup
    #[non_exhaustive]
    #[error(display = "An error occurred during TXT record lookup: {}",
            message)]
    TxtLookupError {
        message: String,
    },

    /// The Client timed out while checking out a connection from connection pool.
    #[non_exhaustive]
    #[error(display =
            "Timed out while checking out a connection from connection pool with address {}",
            address)]
    WaitQueueTimeoutError {
        address: StreamAddress,
    },

    /// An error occurred when trying to execute a write operation
    #[error(display =
            "An error occurred when trying to execute a write operation: {:?}",
            _0)]
    WriteError(WriteFailure),
}

pub enum ConnectionClosedReason {

    /// The connection pool has been cleared since the connection was created.
    Stale,

    /// The connection has been available for longer than `max_idle_time` without being used.
    Idle,

    /// An error occurred while using the connection.
    Error,

    /// The connection was dropped during read or write.
    Dropped,

    /// The pool that the connection belongs to has been closed.
    PoolClosed,
}

pub enum ConnectionCheckoutFailedReason {

    /// The `wait_queue_timeout` has elapsed while waiting for a connection to be available.
    Timeout,

    /// An error occurred while trying to establish a connection (e.g. during the handshake or
    /// authentication).
    ConnectionError,
}

pub enum SelectionCriteria {

    /// A read preference that describes the suitable servers based on the server type, max
    /// staleness, and server tags.
    ///
    /// See the documentation [here](https://docs.mongodb.com/manual/core/read-preference/) for more details.
    #[serde(skip)]
    ReadPreference(ReadPreference),

    /// A predicate used to filter servers that are considered suitable. A `server` will be
    /// considered suitable by a `predicate` if `predicate(server)` returns true.
    #[serde(skip)]
    Predicate(
              #[derivative(Debug = "ignore")]
              Predicate),
}

pub enum ReadPreference {

    /// Only route this operation to the primary.
    Primary,

    /// Only route this operation to a secondary.
    Secondary {
        options: ReadPreferenceOptions,
    },

    /// Route this operation to the primary if it's available, but fall back to the secondaries if
    /// not.
    PrimaryPreferred {
        options: ReadPreferenceOptions,
    },

    /// Route this operation to a secondary if one is available, but fall back to the primary if
    /// not.
    SecondaryPreferred {
        options: ReadPreferenceOptions,
    },

    /// Route this operation to the node with the least network latency regardless of whether it's
    /// the primary or a secondary.
    Nearest {
        options: ReadPreferenceOptions,
    },
}
